import React, { useEffect, useState } from 'react';
import '../styling/TimeFrameSelector.css'; // Import the CSS file

function TimeFrameSelector({ onTimeFrameChange, dateRange }) {
    const today = new Date();
    const year = today.getFullYear();
    let month = today.getMonth() + 1;
    let day = today.getDate();
    month = month < 10 ? '0' + month : month;
    day = day < 10 ? '0' + day : day;
    const todayFormatted = `${year}-${month}-${day}`;

    const [startDate, setStartDate] = useState('2018-06-30');
    const [endDate, setEndDate] = useState(todayFormatted);

    const handleStartDateChange = (e) => {
        setStartDate(e.target.value);
        onTimeFrameChange(e.target.value, endDate);
    };

    const handleEndDateChange = (e) => {
        setEndDate(e.target.value);
        onTimeFrameChange(startDate, e.target.value);
    };

    return (
        <div className="dropdown-container time-frame-selector">
            <div className="dropdown-content">
                <input className="dropdown-option" type="date" value={startDate} onChange={handleStartDateChange} />
            </div>
            <div className="dropdown-header">End Date:</div>
            <div className="dropdown-content">
                <input className="dropdown-option" type="date" value={endDate} onChange={handleEndDateChange} />
            </div>
        </div>
    );
}

export default TimeFrameSelector;
